// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract Bearscat is ERC20 {
    address public nftContract;
    uint256 public tokensPerNFT;
    uint256 public constant DAILY_REWARD_DURATION = 86400; // 24 hours * 60 minutes * 60 seconds
    address private admin;
    address platformAddress;
    mapping(uint256 => bool) private _claimed;
    mapping(uint256 => uint256) private _lastClaim;

    constructor(
        address Admin,
        address _platformAddress,
        address nftContractAddress,
        uint256 _tokensPerNFT
    ) ERC20("Bearies", "Bearies") {
        nftContract = nftContractAddress;
        tokensPerNFT = _tokensPerNFT;
        admin = Admin;
        platformAddress = _platformAddress;
        _mint(msg.sender, 1000 * (10 ** 18));
    }

    function airdrop(address user, uint amount) public {
        require(
            msg.sender == admin || msg.sender == platformAddress,
            "Only Admin or Platform can airdrop."
        );
        _mint(user, amount);
    }

    function claimTokens(uint256[] memory tokenIds) external {
        uint i;

        for (; i < tokenIds.length; i++) {
            uint tokenId = tokenIds[i];
            require(
                IERC721(nftContract).ownerOf(tokenId) == msg.sender,
                "Caller is not the owner of the NFT"
            );
            require(
                block.timestamp >= _lastClaim[tokenId] + DAILY_REWARD_DURATION,
                "Daily reward already claimed"
            );

            _claimed[tokenId] = true;
            _mint(msg.sender, tokensPerNFT);
            _lastClaim[tokenId] = block.timestamp;
        }
    }
}
